import React from 'react';
import { CheckIcon, InProgressIcon } from '../../asset/icons/box/index.js';
import "./progress.css";

const Progress = ({ currentStep }) => (
  <div className="w-full h-full flex justify-start items-center ml">  {/* Here's the changed line */}
    <div className="step-container step-container-confirmed flex flex-col items-center mx-auto">
      <div className={`step ${currentStep > 0 ? 'bg-primary' : 'bg-gray'} flex items-center justify-center`}>
        {currentStep > 0 ? <CheckIcon className='text-white' /> : <InProgressIcon className='text-white' />}
      </div>
      <p className="text-sm text-center">Confirmed</p>
    </div>

    <div className="step-container step-container-in-progress flex flex-col items-center mx-auto">
      <div className={`step ${currentStep > 1 ? 'bg-primary' : 'bg-gray'} flex items-center justify-center`}>
        {currentStep > 1 ? <CheckIcon className='text-white' /> : <InProgressIcon className='text-white' />}
      </div>
      <p className="text-sm text-center">In Progress</p>
    </div>

    <div className="step-container step-container-ready flex flex-col items-center mx-auto">
      <div className={`step ${currentStep > 2 ? 'bg-primary' : 'bg-gray'} flex items-center justify-center`}>
        {currentStep > 2 ? <CheckIcon className='text-white' /> : <InProgressIcon className='text-white' />}
      </div>
      <p className="text-sm text-center">Ready</p>
    </div>
  </div>
);

export default Progress;
